import Post from "./components/Post";
import { Routes, Route } from "react-router-dom";
function App() {
  return (
    <Routes>
      <Route
        index
        element={
          <Post />
        }
      ></Route>
      <Route path={'/login'} element={

<div>Login Page</div>
      }></Route>
    </Routes>
  );
}

export default App;
